import React from 'react';
import './Business.css';
import { homeObjFour, homeObjOne, homeObjThree, homeObjTwo} from '../data';
import Template from '../Template';

function Business() {
    return (
        <>
        <div className='page-name'
        style = {{
            height: '120px',
            backgroundColor: '#f5f5f5'

        }}>
            <h1 style = {{
            fontSize: '60px',
            paddingTop: '20px'

        }}>
                Business</h1>
            <hr></hr>
        </div>
        <Template {...homeObjOne} />
        <Template {...homeObjTwo} />
        <Template {...homeObjThree} />
        <Template {...homeObjFour} />
        </> 










    )
}

export default Business;
